import unicodedata

def vowels_count(s):
    """"""
    count = 0
    vowels = 'aeiou'
    s = unicodedata.normalize('NFD', s.lower())
    for i in range(len(s)):
        if s[i] in vowels:
            count += 1
        if s[i] == 'y' and i == len(s) - 1:
            count += 1
    return count
